Comment:
In a world where we 'debate' if changing the atmospheric chemistry 'might' change weather;
where smoking is 'debated' if it is unhealthy;
where we are okay with a few people owning and controlling the vast wealth and power of a country as long as we 'feel' like we get to do our own thing day to day;
where we can't agree if an election result was fair or not;
there is no way people in general will give up their freedom of choice to a machine-system, even if such a system is far superior to our existing one by every possible measure.

Things fall apart; the centre cannot hold;
Mere anarchy is loosed upon the world,
The blood-dimmed tide is loosed, and everywhere
The ceremony of innocence is drowned;
The best lack all conviction, while the worst
Are full of passionate intensity.

Surely some revelation is at hand;
Surely the Second Coming is at hand.
The Second Coming!

Imagine reading MY mind.
You’ll have nightmares.
OR, I’ll just keep thinking of rick roll, so you’ll get rick rolled every time you read mah mind ;w;
